import React from 'react';
import { Carousel, Jumbotron, Container, Row, Col } from 'react-bootstrap';
import FooterAluno from '../../components/footeraluno';
import HeaderAluno from '../../components/headeraluno';
import foto1 from '../../assets/img/escola.jpg';
import foto2 from '../../assets/img/objetivos.jpg';
import foto3 from '../../assets/img/turmas.jpg';

const Home = () => {
    return(
        <div>
        <HeaderAluno />
        <Jumbotron fluid>
            <Container>
                <Row>
                <Carousel>
                    <Carousel.Item>
                        <img
                            src={foto1}
                            alt="First slide"
                            width={600}
                            height={300}
                        />
                        <Carousel.Caption>
                            <h3>First slide label</h3>
                            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            src={foto2}
                            alt="Third slide"
                            width={600}
                            height={300}
                        />

                        <Carousel.Caption>
                            <h3>Second slide label</h3>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            src={foto3}
                            alt="Third slide"
                            width={600}
                            height={300}
                        />

                        <Carousel.Caption>
                            <h3>Third slide label</h3>
                            <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Col>3 of 3</Col>
                </Carousel>
                </Row>
            </Container>
        </Jumbotron> 
        <FooterAluno />
        </div>
    )
}

export default Home;
